import { useEffect, useState } from "react";
import "./UserPanel.css";
export default function UserPanel({ items, userIdLogged }) {
  const [userItems, setUserItems] = useState([]);
  const [error, setError] = useState("");
  const [userDetails, setUserDetails] = useState("");
  const [userError, setUserError] = useState("");
  const [createdAt, setCreated] = useState({ date: "", time: "" });

  function formatTimestamp(timestamp) {
    const dateObject = new Date(timestamp);

    // Extract date components
    const year = dateObject.getFullYear();
    const month = dateObject.getMonth() + 1; // Months are zero-based
    const day = dateObject.getDate();

    // Extract time components
    const hours = dateObject.getHours();
    const minutes = dateObject.getMinutes();
    const seconds = dateObject.getSeconds();

    // Format date and time
    const formattedDate = `${year}-${month.toString().padStart(2, "0")}-${day
      .toString()
      .padStart(2, "0")}`;
    const formattedTime = `${hours.toString().padStart(2, "0")}:${minutes
      .toString()
      .padStart(2, "0")}:${seconds.toString().padStart(2, "0")}`;

    setCreated({ date: formattedDate, time: formattedTime });
  }

  function getUserItems() {
    fetch("http://localhost:5000/get-user-items", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        userId: userIdLogged,
      }),
    })
      .then((response) => {
        if (!response.ok) {
          return response.json().then((error) => {
            throw new Error(error.message || "Error");
          });
        }
        return response.json();
      })
      .then((data) => {
        setUserItems(data);
      })
      .catch((err) => {
        setError(err.message);
      });
  }

  function getUserDetails() {
    fetch("http://localhost:5000/get-user-details", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        userId: userIdLogged,
      }),
    })
      .then((response) => {
        if (!response.ok) {
          return response.json().then((error) => {
            throw new Error(error.message || "Error");
          });
        }
        return response.json();
      })
      .then((data) => {
        setUserDetails(data);
        formatTimestamp(data.createdAt);
      })
      .catch((err) => {
        setUserError(err.message);
      });
  }

  useEffect(() => {
    getUserItems();
    getUserDetails();
  }, [userIdLogged]);

  return (
    <>
      <div className="side-bar">
        <ul>
          <li>
            <div className="side-bar-li-flex">
              <p>Edit username</p>
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="100px"
                height="50px"
                viewBox="0 0 24 24"
                fill="none"
              >
                <circle
                  cx="12"
                  cy="6"
                  r="4"
                  stroke="#1C274C"
                  stroke-width="1.5"
                />
                <path
                  d="M19.9975 18C20 17.8358 20 17.669 20 17.5C20 15.0147 16.4183 13 12 13C7.58172 13 4 15.0147 4 17.5C4 19.9853 4 22 12 22C14.231 22 15.8398 21.8433 17 21.5634"
                  stroke="#1C274C"
                  stroke-width="1.5"
                  stroke-linecap="round"
                />
              </svg>
            </div>
          </li>
          <li>
            <div className="side-bar-li-flex">
              <p>Edit firstname</p>
              <img
                src="https://cdn-icons-png.flaticon.com/512/6135/6135265.png"
                alt="edit Name"
                width="100px"
                height="50px"
              />
            </div>
          </li>
          <li>
            <div className="side-bar-li-flex">
              <p>Edit password</p>
              <img
                className="editPasswordImage"
                src="https://static.vecteezy.com/system/resources/previews/010/702/533/non_2x/password-reset-icon-flat-design-vector.jpg"
                alt="edit password"
                width="100px"
                height="70px"
              />
            </div>
          </li>
          <li>
            <div className="side-bar-li-flex">
              <p>Edit lastname</p>
              <img
                className="editPasswordImage"
